import React from "react";
import "./Merchant.css";

function Merchant(props) {
  //const merchant = props.merchant;
  console.log("props", props);
  const img = props.merchant.coverImageId;
  const shopName = props.merchant.shopNameTH;

  return (
    <div>
      <img src={`${img}`} width="100" height="100"></img>
      <div style={{ color: "green" }}>{shopName}</div>
    </div>
  );
}

export default Merchant;
